import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import SearchBar from '../Search/SearchBar';
import styles from './Header.module.css';

const Header = () => {
  const [isMenuOpen, setIsMenuOpen] = useState(false);
  const [isSearchActive, setIsSearchActive] = useState(false);

  const toggleMenu = () => {
    setIsMenuOpen(!isMenuOpen);
    if (!isMenuOpen) {
      setIsSearchActive(false);
    }
  };

  const handleSearchToggle = () => {
    setIsSearchActive(!isSearchActive);
    if (isMenuOpen) {
      setIsMenuOpen(false);
    }
  };

  const handleSearchClose = () => {
    setIsSearchActive(false);
  };

  return (
    <header className={styles.header}>
      <div className={styles.container}>
        {/* Mobile Menu Button */}
        <button
          className={`${styles.menuButton} ${isMenuOpen ? styles.active : ''}`}
          onClick={toggleMenu}
          aria-label="Toggle menu"
        >
          <ion-icon name={isMenuOpen ? 'close-outline' : 'menu-outline'} />
        </button>

        {/* Logo */}
        <Link to="/" className={styles.logo}>
          SneakerAlot
        </Link>

        {/* Navigation */}
        <nav className={`${styles.nav} ${isMenuOpen ? styles.active : ''}`}>
          <ul className={styles.navList}>
            <li><Link to="/new-arrivals">New Arrivals</Link></li>
            <li><Link to="/men">Men</Link></li>
            <li><Link to="/women">Women</Link></li>
            <li><Link to="/kids">Kids</Link></li>
            <li><Link to="/sale">Sale</Link></li>
          </ul>
        </nav>

        {/* Actions */}
        <div className={styles.actions}>
          {/* Search Toggle for Mobile */}
          <button
            className={`${styles.searchToggle} ${isSearchActive ? styles.active : ''}`}
            onClick={handleSearchToggle}
            aria-label="Toggle search"
          >
            <ion-icon name={isSearchActive ? 'close-outline' : 'search-outline'} />
          </button>

          {/* Desktop Search */}
          <div className={styles.searchContainer}>
            <SearchBar 
              isExpanded={isSearchActive}
              onClose={handleSearchClose}
            />
          </div>

          {/* User Actions */}
          <div className={styles.userActions}>
            <button className={styles.actionButton} aria-label="Wishlist">
              <ion-icon name="heart-outline" />
            </button>
            <button className={styles.actionButton} aria-label="Shopping cart">
              <ion-icon name="bag-outline" />
              <span className={styles.badge}>0</span>
            </button>
            <button className={styles.actionButton} aria-label="User account">
              <ion-icon name="person-outline" />
            </button>
          </div>
        </div>
      </div>

      {/* Mobile Search */}
      <div className={`${styles.mobileSearch} ${isSearchActive ? styles.active : ''}`}>
        <SearchBar 
          isExpanded={isSearchActive}
          onClose={handleSearchClose}
        />
      </div>
    </header>
  );
};

export default Header;
